import React, { Component } from 'react';

const style = {
    container: {
        width: '30%',
        height: '30%',
        backgroundColor: 'black'
    }
}


export class ToDoComponent extends Component {

    render() { 
        return ( 
            <div>
                <h2>Todo List</h2>
                <div style={style.container}>

                </div>
            </div>
         );
    }
}

export default ToDoComponent;
